--  DDL for Procedure ALN_PLANNED_TRANSACTION_DATES
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MAC_FINANCIAL_ADMIN"."ALN_PLANNED_TRANSACTION_DATES" AS 
BEGIN
  UPDATE PLANNED_TRANSACTION
  SET PLANNED_TRANSACTION_DATE = TO_DATE(LPAD(TO_CHAR(EXTRACT(DAY FROM PLANNED_TRANSACTION_DATE)),2,0) || '-' || 
                                         LPAD((SELECT MONTH FROM BUDGET_ITEM WHERE ID = BUDGET_ITEM_ID),2,0) || '-' || 
                                         SUBSTR(TO_CHAR((SELECT YEAR FROM BUDGET_ITEM WHERE ID = BUDGET_ITEM_ID)),3,2),'DD-MM-YY')
 where extract(month from planned_transaction_date) <> (SELECT MONTH FROM BUDGET_ITEM WHERE ID = BUDGET_ITEM_ID)
    or extract(year from planned_transaction_date) <> (SELECT YEAR FROM BUDGET_ITEM WHERE ID = BUDGET_ITEM_ID);
END ALN_PLANNED_TRANSACTION_DATES;

